import React from 'react';
import {ReactComponent as PlusImage} from '../../assets/plus_icon.svg';
import {DecksButtonContainer, LeftPane, MiddlePane, RightPane,
    LeftAddPane, MiddleAddPane, RightAddPane, PlusIcon} from './decks-button.styles';

const DecksButton = ({isAdd}) => {
    console.log("Decks Button Component isAdd: ", isAdd);
    return <DecksButtonContainer> {!isAdd ? <><LeftPane/><MiddlePane/><RightPane/></> : <><LeftAddPane/><MiddleAddPane/><RightAddPane/><PlusIcon>{PlusImage}</PlusIcon></>}</DecksButtonContainer>
}

export default DecksButton;
